import React from 'react';
import './Home.css';

const Home = () => {
  return (
    <div className="home-container">
      <h1 className="home-title">Welcome to Achu's Home Foods</h1>
      <p className="home-tagline">Fresh. Homemade. Healthy.</p>
      <button className="shop-now-btn">Shop Now</button>
    </div>
  );
};

export default Home;
